import React, { useState, useEffect } from 'react';

import './App.css';

function App() 
{
  const [msg, setMsg] = useState("");

  const getMsg = (e) => 
  {
      console.log("got Message...");
      setMsg(e.target.value);
      <h1>{msg}</h1>
  }

  return (
    <div className="App">
      <h1> Covid-19 ChatBot</h1>
      <input 
        type = "text" 
        className ="msg"
        placeholder="Enter message here"
        onChange={getMsg}
        value={msg} 
        />
    </div>
  );
}

export default App;
